import "./ContactPage.css";
import { FaInstagramSquare, FaFacebook } from "react-icons/fa";

function ContactPage() {
	return (
		<div className="ContactPage">
			<link
				href="https://cdnjs.cloudflare. com/ajax/libs/font-awesome/4.7.0/css/font-awesome.css"
				rel="stylesheet"
			/>
			<i class="fa fa-instagram" id="insta" aria-hidden="true">
				;
			</i>

			<div className="ContactPageCard" id="instagram">
				Instagram <FaInstagramSquare className="ContactIcon" />
			</div>
			<div className="ContactPageCard">
				Facebook <FaFacebook className="ContactIcon" />
			</div>
		</div>
	);
}

export default ContactPage;
